def connect_to_database(passwd, database_file_path):
    """Подключение к базе данных с паролем. Возвращает conn и cursor."""
    try:
        conn = sqlite3.connect(database_file_path)
        conn.create_function("LOWER", 1, sqlite_lower)
        cursor = conn.cursor()
        cursor.execute(f"PRAGMA key = '{passwd}';")
        cursor.execute("SELECT name FROM sqlite_master WHERE type='table';")
        if cursor.fetchall():
            return conn, cursor
    except Exception:
        return None, None


def sqlite_lower(value_):
    """Функция для приведения строки к нижнему регистру для SQL-запросов."""
    return str(value_).lower()


def is_tipa_inn(value):
    """Проверка на соответствие РНОКПП (ИНН)."""
    return bool(re.fullmatch(r"\d{10}", value))  # РНОКПП должен содержать ровно 10 цифр


def execute_query(cursor, query, params=None):
    """Универсальная функция для выполнения SQL-запросов."""
    cursor.execute(query, params or {})
    return cursor.fetchall()


