def get_award_and_presentation_info(person_ids, cursor):
    """Получаем информацию по наградам и поданиям для списка личностей."""
    stringTab1 = ""
    imgList = []
    counts_gid01 = 0
    source_data_award_and_presentation = {} # тут храним сирой вивод БД для обработки

    for pid in person_ids:
        person_output = ""

        # --- Награды ---
        awards = execute_query(cursor, """
            SELECT id_personality, id_award, date_decree, decree, number_meed,
                   date_handover, handover, consignment_note,
                   (SELECT name FROM personality WHERE id = meed.id_personality),
                   (SELECT rank FROM personality WHERE id = meed.id_personality),
                   (SELECT inn FROM personality WHERE id = meed.id_personality),
                   (SELECT unit FROM personality WHERE id = meed.id_personality),
                   (SELECT registration FROM presentation WHERE id_personality = meed.id_personality),
                   (SELECT date_registration FROM presentation WHERE id_personality = meed.id_personality),
                   (SELECT denotation FROM award WHERE id = meed.id_award),
                   id, dead
            FROM meed WHERE id_personality = :id
        """, {"id": pid})

        # Создаем список для хранения данных о каждой награде вместе с информацией о вручении
        processed_awards_data = []

        if awards:
            counts_gid01 += 1            

        for row in awards:
            inn = str(row[10]).split('.')[0] if row[10] else ' '
            deadTxt = " (посмертно)" if row[16] == "1" else ""
            person_output += f'\n* {row[8]} {row[9]} ({inn}, {row[11]}){deadTxt} *\n {row[14]} \n'
            person_output += f' - указ/наказ : №{row[3]} від {row[2]};\n'

            imgList.append(row[1])

            string_handover_value = ""
            if row[7] and row[4]:
                person_output += f' - накладна {row[7]}.'
                string_handover_value = f'\n - нагороду {row[4]}'

                if row[6]:
                    hto = execute_query(cursor, "SELECT name FROM personality WHERE id = :id", {"id": row[6]})
                    string_handover_value += f' вручено: {row[5]}, {hto[0][0] if hto else row[6]}.\n'
                else:
                    string_handover_value += ' не вручено.\n'

                person_output += f' {string_handover_value}'

            # Создаем словарь для ТЕКУЩЕЙ награды, включая оригинальные данные и информацию о вручении
            award_details = {
                'raw_data': row, # Возможно, полезно сохранить всю исходную строку
                'handover_info': string_handover_value # Сохраняем вычисленную строку о вручении
            }

            processed_awards_data.append(award_details)

        source_data_award_and_presentation[pid] = {'meed': processed_awards_data}

        # --- Подання ---
        presentations = execute_query(cursor, """
            SELECT registration, date_registration,
                   (SELECT name FROM personality WHERE id = presentation.id_personality),
                   (SELECT rank FROM personality WHERE id = presentation.id_personality),
                   (SELECT inn FROM personality WHERE id = presentation.id_personality),
                   (SELECT unit FROM personality WHERE id = presentation.id_personality),
                   id, id_meed, worker, report, text_presentation
            FROM presentation WHERE id_personality = :id
        """, {"id": pid})

        source_data_award_and_presentation.setdefault(pid, {})['presentations'] = presentations

        for row in presentations:
            inn = str(row[4]).split('.')[0] if row[4] else ' '
            worker = "ВП" if row[8] == 0 else "МПЗ" if row[8] == 1 else "інші"

            if row[7] is None:
                Vidmova = "(НА РОЗГЛЯДІ)"
            elif str(row[7]) == "0":
                Vidmova = "(ВІДМОВЛЕНО)"
            else:
                Vidmova = ""

            deadTxtP = "(посмертно)" if row[9] == "посмертно" else ""
            t_report = "" if row[9] == "посмертно" else row[9]

            person_output += f'\n* {row[3]} {row[2]} ({inn}, {row[5]}) {deadTxtP} *\n'
            person_output += f' подання №{row[0]} від {row[1]}. вик.{worker} {t_report} {Vidmova}\n'

        if person_output.strip():
            stringTab1 += person_output + "\n****\n"

    return stringTab1, imgList, counts_gid01, source_data_award_and_presentation


def get_award_image_blobs_for_search(imgList, counts_gid01, cursor):
    """    Извлекает бинарные данные изображений (BLOB) для списка ID наград    """
    if not cursor or not imgList or counts_gid01 != 1:
        return []

    award_ids = [item for item in imgList if isinstance(item, (int, str)) and str(item).isdigit()]
    unique_ids = list(set(int(id) for id in award_ids))

    if not unique_ids:
        return []

    try:
        placeholders = ','.join('?' for _ in unique_ids)
        query = f"SELECT id, img FROM award WHERE id IN ({placeholders})"
        cursor.execute(query, unique_ids)
        rows = cursor.fetchall()
        image_blobs = [row[1] for row in rows if row[1] is not None and isinstance(row[1], bytes)]
        return image_blobs
    except Exception:
        return []



# -------------- класс для построения графика ------------------------

class AwardDataLoader:
    def __init__(self, start_year):
        self.start_year = start_year
        self.last_meed_date = None
        self.count_present = None
        self.count_presentPers = None
        self.x_data = []
        self.y_data_state_awards = []
        self.y_data_all_awards = []
        self.y_data_presentations = []
        self.state_award_ids = set()

    def load_data(self, cursor):
        if not cursor:
            self._initialize_empty_data()
            return

        try:
            # Получаем основные данные
            query = """
                SELECT
                    (SELECT date_decree FROM meed ORDER BY date_decree DESC LIMIT 1),
                    (SELECT COUNT(id) FROM presentation WHERE id_meed IS NULL OR TRIM(id_meed) = ''),
                    (SELECT COUNT(id) FROM presentation WHERE (id_meed IS NULL OR TRIM(id_meed) = '') AND worker = 0)
            """
            main_data_row = execute_query(cursor, query)
            if main_data_row and main_data_row[0] and len(main_data_row[0]) == 3:
                self.last_meed_date, self.count_present, self.count_presentPers = main_data_row[0]
            else:
                self._initialize_empty_data()
                return

            # Получаем идентификаторы государственных наград
            query = "SELECT id FROM award WHERE ranking <= 5"
            state_award_results = execute_query(cursor, query)
            self.state_award_ids = {row[0] for row in state_award_results}

            # Получаем все данные по наградам и поданням
            query = "SELECT date_decree, id_award FROM meed"
            all_meeds = execute_query(cursor, query)

            query = "SELECT date_registration FROM presentation"
            all_presentations = execute_query(cursor, query)

            state_awards_by_year = defaultdict(int)
            all_awards_by_year = defaultdict(int)
            presentations_by_year = defaultdict(int)

            # Обрабатываем данные
            for date_str, award_id in all_meeds:
                try:
                    year = int(date_str[:4])
                    all_awards_by_year[year] += 1
                    if award_id in self.state_award_ids:
                        state_awards_by_year[year] += 1
                except (ValueError, TypeError):
                    continue

            for (date_str,) in all_presentations:
                try:
                    year = int(date_str[:4])
                    presentations_by_year[year] += 1
                except (ValueError, TypeError):
                    continue

            # Заполняем списки данных для графика
            self.x_data = []
            self.y_data_state_awards = []
            self.y_data_all_awards = []
            self.y_data_presentations = []
            current_year = datetime.now().year

            for year in range(self.start_year, current_year + 1):
                self.x_data.append(year)
                self.y_data_state_awards.append(state_awards_by_year[year])
                self.y_data_all_awards.append(all_awards_by_year[year])
                self.y_data_presentations.append(presentations_by_year[year])

        except Exception:
            self._initialize_empty_data()

    def _initialize_empty_data(self):
        """Инициализирует атрибуты AwardDataLoader пустыми значениями при ошибке загрузки."""
        self.x_data = []
        self.y_data_state_awards = []
        self.y_data_all_awards = []
        self.y_data_presentations = []
        self.last_meed_date = "Ошибка загрузки данных"
        self.count_present = 0
        self.count_presentPers = 0
        self.state_award_ids = set()

    def get_graph_data(self):
        """Возвращает данные для построения графика."""
        return self.x_data, self.y_data_state_awards, self.y_data_all_awards, self.y_data_presentations

    def get_status_text(self):
        date_str = str(self.last_meed_date) if self.last_meed_date else "Нет данных"
        return f"Остання нагорода: {date_str}, нерозглянуті подання: {self.count_present} (ВП - {self.count_presentPers})"

