def get_treedata(cursor):
    """
    Loads award data from the database.
    Returns a dictionary structured as {category: {award_name: {details_dict}}}
    where details_dict includes id, law, grounds, and image (BLOB).
    """
    if not cursor:
        return {}

    awards_data = {}
    try:
        cursor.execute("SELECT id, denotation, law, grounds, img, ranking FROM award ORDER BY ranking;")
        rows = cursor.fetchall()
        for row in rows:
            award_id, award_name, law_desc, grounds_desc, image_data, ranking = row
            ranking_description = "Невідоме ранжирування"

            if isinstance(ranking, int):
                if 0 <= ranking < len(RankingValues):
                    ranking_description = RankingValues[ranking]

            if ranking_description not in awards_data:
                awards_data[ranking_description] = {}

            awards_data[ranking_description][award_name] = {
                "award_id": award_id,
                "law": law_desc,
                "grounds": grounds_desc,
                "image": image_data,
                "original_ranking_int": ranking,
            }

    except sqlite3.Error as e:
        awards_data = {}

    return awards_data


def save_award_to_db(conn, cursor, award_id, award_name, short_desc, full_desc, image_data, ranking):
    """
    Сохраняет изменения для существующей награды в базе данных.
    Принимает conn, cursor, ID награды, название, краткое и полное описание,
    BLOB изображения и ранжирование.
    Возвращает True при успехе, False при ошибке.
    """
    try:
        if not conn or not cursor:
            return False

        cleaned_award_name = award_name.strip().replace('\n', ' ')

        query = """
            UPDATE award SET
                denotation = ?,
                law = ?,
                grounds = ?,
                img = ?,
                ranking = ?
            WHERE id = ?
        """
        params = (cleaned_award_name, short_desc, full_desc, image_data, ranking, award_id)

        cursor.execute(query, params)
        conn.commit()

        return cursor.rowcount > 0

    except sqlite3.Error as e:
        if conn:
            conn.rollback()
        return False
    except Exception as e:
        return False


def create_award_in_db(conn, cursor, category_name, award_name, short_desc, full_desc, image_data, ranking):
    """
    Creates a new award record in the database using the provided schema.

    Args:
        conn: The database connection object.
        cursor: The database cursor object.
        category_name (str): The category name (used in UI, determines ranking).
        award_name (str): The name of the award (denotation).
        short_desc (str): The short description/law of the award (law).
        full_desc (str): The full description/grounds of the award (grounds).
        image_data (bytes): The image data (BLOB) for the award (img).
        ranking (int): The ranking value for the award (ranking).

    Returns:
        int: The ID of the newly created award if successful, None otherwise.
    """
    try:
        cleaned_award_name = award_name.strip().replace('\n', ' ')

        cursor.execute("""
            INSERT INTO award (denotation, law, grounds, img, ranking)
            VALUES (?, ?, ?, ?, ?)
        """, (cleaned_award_name, short_desc, full_desc, image_data, ranking))
        conn.commit()
        return cursor.lastrowid
    except sqlite3.Error as e:
        conn.rollback()
        return None


def delete_award_from_db(conn, cursor, award_id):
    """Deletes an award record from the database."""
    try:
        cursor.execute("DELETE FROM award WHERE id = ?", (award_id,))
        conn.commit()
        return cursor.rowcount > 0
    except sqlite3.Error as e:
        conn.rollback()
        return False

