# Функция для создания базы данных (если её нет)
def create_database(database_file_path, passwd):

    import base64, wx      

    # Connect to the database (if it doesn't exist, it will be created)
    with sqlite3.connect(database_file_path) as db:

        # Create a cursor object to interact with the database
        cursor = db.cursor()
        cursor.execute(f"PRAGMA key = '{passwd}';")

        # Create a table
        cursor.execute("""
            CREATE TABLE IF NOT EXISTS award (
                id INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL UNIQUE,
                denotation TEXT,
                law TEXT,
                grounds TEXT,
                img BLOB,
                ranking INTEGER
            )
        """)
        cursor.execute("""
            CREATE TABLE IF NOT EXISTS law (                
                law_denotation TEXT,
                law_link TEXT,
                law_date TEXT,
                law_number TEXT,
                id_law INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL UNIQUE
            )
        """)
        cursor.execute("""
            CREATE TABLE IF NOT EXISTS meed (
                id INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL UNIQUE,
                id_personality INTEGER,
                id_award INTEGER,
                date_decree TEXT,
                decree TEXT,
                number_meed TEXT,
                date_handover TEXT,
                handover TEXT,
                consignment_note TEXT,
                dead INTEGER
            )
        """)
        cursor.execute("""
            CREATE TABLE IF NOT EXISTS personality (
                id INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL UNIQUE,
                unit TEXT,
                rank TEXT,
                name TEXT,
                date_birth TEXT,
                inn REAL
            )
        """)
        cursor.execute("""
            CREATE TABLE IF NOT EXISTS libs (
                id INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL UNIQUE,
                rank_src TEXT,
                unit_src TEXT
            )
        """)
        cursor.execute("""
            CREATE TABLE IF NOT EXISTS presentation (
                id INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL UNIQUE,
                text_presentation TEXT,
                registration TEXT,
                date_registration TEXT,
                id_personality INTEGER,
                id_meed INTEGER,
                report TEXT,
                worker INTEGER
            )
        """)
        # Создаём FTS3-таблицу для полнотекстового поиска
        cursor.execute("""
            CREATE VIRTUAL TABLE IF NOT EXISTS presentation_fts USING fts3(
                id, 
                text_presentation,
                tokenize=unicode61
            )
        """)
        cursor.execute("""
            CREATE TABLE IF NOT EXISTS service_ (
                logo BLOB,
                exel_butt BLOB,
                view_butt BLOB,
                or_butt BLOB,
                id INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL UNIQUE,
                pass TEXT,
                cookies TEXT,
                zvit_dir TEXT,
                img_homer BLOB,
                img_homer2 BLOB,
                last_time_changes INTEGER,
                zvit_fields TEXT,
                show_hellou INTEGER
            )
        """)

        # --- 3. КОМАНДЫ СОЗДАНИЯ ИНДЕКСОВ ---
        cursor.execute("CREATE INDEX idx_meed_id_personality ON meed (id_personality);")
        cursor.execute("CREATE INDEX idx_presentation_id_meed ON presentation (id_meed);")
        cursor.execute("CREATE INDEX idx_meed_consignment_note ON meed (consignment_note);")
        cursor.execute("CREATE INDEX idx_meed_handover ON meed (handover);")
